import React from "react";
import classes from '../Products./ProductsSummary.module.css';

const ProductSummary = () => {
  return (
    <section className={classes.summary}>
    <p> Choose your products from our board selection of availaible products</p>
    <p> All our products are High-Quality brands </p>
      <h2>Products Delivered to you ! </h2>
    </section>
  );
};

export default ProductSummary;
